--
-- Name: mv_catalogue; Type: MATERIALIZED VIEW; Schema: public; Owner: postgres
--

CREATE MATERIALIZED VIEW public.mv_catalogue AS
 SELECT p.productid,
    p.productcode,
    p.productname,
    lower((p.productname)::text) AS productname_lower,
    lower((p.productcode)::text) AS productcode_lower,
    b.brandname AS famille,
    lower((COALESCE(b.brandname, ''::character varying))::text) AS brandname_lower,
    p.baseprice AS prixvente,
    p.purchaseprice AS prixachat,
    p.calibre,
    p.choix,
    p.qteparcolis,
    p.qtecolisparpalette,
    p.size,
    COALESCE(inv.totalqty, (0)::numeric) AS totalqty,
    COALESCE(inv.nbpalette, (0)::numeric) AS nbpalette,
    COALESCE(inv.nbcolis, (0)::numeric) AS nbcolis,
        CASE
            WHEN (p.qteparcolis > (0)::numeric) THEN p.qteparcolis
            WHEN (COALESCE(inv.nbcolis, (0)::numeric) > (0)::numeric) THEN round((COALESCE(inv.totalqty, (0)::numeric) / COALESCE(inv.nbcolis, (1)::numeric)), 4)
            ELSE (0)::numeric
        END AS derivedpiecespercolis,
        CASE
            WHEN (p.qtecolisparpalette > (0)::numeric) THEN p.qtecolisparpalette
            WHEN (COALESCE(inv.nbpalette, (0)::numeric) > (0)::numeric) THEN round((COALESCE(inv.nbcolis, (0)::numeric) / COALESCE(inv.nbpalette, (1)::numeric)), 4)
            ELSE (0)::numeric
        END AS derivedcolisperpalette
   FROM ((public.products p
     LEFT JOIN public.brands b ON ((p.brandid = b.brandid)))
     LEFT JOIN ( SELECT inventory.productid,
            sum(inventory.quantityonhand) AS totalqty,
            sum(inventory.palletcount) AS nbpalette,
            sum(inventory.coliscount) AS nbcolis
           FROM public.inventory
          WHERE ((inventory.ownershiptype)::text = 'OWNED'::text)
          GROUP BY inventory.productid) inv ON ((p.productid = inv.productid)))
  WHERE (p.isactive = true)
  WITH NO DATA;


ALTER MATERIALIZED VIEW public.mv_catalogue OWNER TO postgres;

