--
-- Name: vw_currentinventory; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vw_currentinventory AS
 SELECT i.inventoryid,
    i.productid,
    i.warehouseid,
    p.productcode,
    p.productname,
    w.warehousename,
    i.ownershiptype,
    f.factoryname,
    i.quantityonhand,
    i.quantityreserved,
    i.quantityavailable,
    i.reorderlevel,
    COALESCE(i.palletcount, (0)::numeric) AS palletcount,
    COALESCE(i.coliscount, (0)::numeric) AS coliscount,
    b.brandname
   FROM ((((public.inventory i
     JOIN public.products p ON ((i.productid = p.productid)))
     JOIN public.warehouses w ON ((i.warehouseid = w.warehouseid)))
     LEFT JOIN public.factories f ON ((i.factoryid = f.factoryid)))
     LEFT JOIN public.brands b ON ((p.brandid = b.brandid)))
  WHERE (p.isactive = true);


ALTER VIEW public.vw_currentinventory OWNER TO postgres;

--
-- Name: vw_customerbalances; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vw_customerbalances AS
 SELECT c.customerid,
    c.customercode,
    c.customername,
    c.customertype,
    c.creditlimit,
    COALESCE(sum(inv.balanceamount), (0)::numeric) AS outstandingbalance,
    (c.creditlimit - COALESCE(sum(inv.balanceamount), (0)::numeric)) AS availablecredit
   FROM (public.customers c
     LEFT JOIN public.invoices inv ON (((c.customerid = inv.customerid) AND ((inv.status)::text = ANY (ARRAY[('UNPAID'::character varying)::text, ('PARTIAL'::character varying)::text, ('OVERDUE'::character varying)::text])))))
  GROUP BY c.customerid, c.customercode, c.customername, c.customertype, c.creditlimit;


ALTER VIEW public.vw_customerbalances OWNER TO postgres;

